  CONSTRAINT `matches_ibfk_4` FOREIGN KEY (`referee_id`) REFERENCES `persons` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=381 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
