DROP TABLE IF EXISTS `persons`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `persons` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT 'ФИО игрока',
  `team_id` bigint unsigned NOT NULL,
  `position_id` bigint unsigned NOT NULL,
  `nationality` bigint unsigned NOT NULL,
  `number` smallint unsigned DEFAULT NULL,
  `status` enum('Injured','Disqualified','Ready to play') DEFAULT 'Ready to play',
  `birthday` date DEFAULT NULL,
  `img_name` varchar(255) DEFAULT NULL COMMENT 'Название файла с фото игрока',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `index_team` (`team_id`),
  KEY `nationality` (`nationality`),
  KEY `position_id` (`position_id`),
  CONSTRAINT `persons_ibfk_1` FOREIGN KEY (`nationality`) REFERENCES `countries` (`id`),
  CONSTRAINT `persons_ibfk_2` FOREIGN KEY (`position_id`) REFERENCES `positions` (`id`),
  CONSTRAINT `persons_ibfk_3` FOREIGN KEY (`team_id`) REFERENCES `teams` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=586 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
